import React from 'react'
import { Video } from 'grommet'

export const Vid = () => {
    return (
        <Video controls="over" fit="cover">
            <source key="video" src="./kaaris.mp4" type="video/mp4" />
            <track>
            default</track>
        </Video>
    )
}



export default Vid
